The Wombats - Techno Fan (2011)(EP)(Including Official Video MP4 720p)(MP3@256)









&quot;Techno Fan&quot; is a single from alternative-pop group, The Wombats. The single will be released in the United Kingdom on 5 June 2011 as a digital download on iTunes including three B-sides; &quot;Avalanche&quot;, &quot;Trampolining&quot; and &quot;Shock Goodbyes and P45's&quot;. This is the 4th single from the album This Modern Glitch, following &quot;Tokyo (Vampires &amp; Wolves)&quot;, &quot;Jump Into the Fog&quot; and &quot;Anti-D&quot;. The single has peaked to number 60 on the UK Singles Chart.


The Wombats announced on 31 May 2011 their forth single from the album would be &quot;Techno Fan&quot; and the 4-track EP would include three unheard B-sides. It was released on 6 June 2011.


The music video for the song was uploaded to YouTube on April 19, 2011.

